import { Grid } from "@material-ui/core";
import {
  AccountCircle,
  HomeRounded,
  PhoneAndroidRounded,
} from "@material-ui/icons";
import FormSpacer from "components/FormSpacer";
import React from "react";
import InputCustomize from "./components/InputCustomize";
import SwitchCustomize from "./components/SwitchCustomize";

function ProfileForm(props) {
  return (
    <form>
      <Grid container spacing={3}>
        <Grid container item xs={6}>
          <InputCustomize
            title="Firstname"
            icon={() => <AccountCircle color="action" />}
          />
        </Grid>
        <Grid container item xs={6}>
          <InputCustomize
            title="Lastname"
            icon={() => <AccountCircle color="action" />}
          />
        </Grid>
      </Grid>
      <FormSpacer />
      <Grid container spacing={3}>
        <Grid container item xs={4}>
          <InputCustomize
            title="Address"
            icon={() => <HomeRounded color="action" />}
          />
        </Grid>
        <Grid container item xs={4}>
          <InputCustomize
            title="Lastname"
            icon={() => <AccountCircle color="action" />}
          />
        </Grid>
        <Grid container item xs={4}>
          <InputCustomize
            title="Lastname"
            icon={() => <AccountCircle color="action" />}
          />
        </Grid>
      </Grid>
      <InputCustomize
        title="Phone"
        icon={() => <PhoneAndroidRounded color="action" />}
      />
      <FormSpacer />

      <FormSpacer />

      <SwitchCustomize checked handleChange={(e) => console.log(e)} />
    </form>
  );
}

export default ProfileForm;
